import React from 'react';
import '../styles.css';
import Navbar from '../components/NavBar'

const sections = [
  {title: 'Home', route:'/'}, 
  {title: 'About', route:'/about'}, 
  {title: 'What Am I Reading', route:'/wair'}, 
  {title: 'Portfolio', route:'/portfolio'},
]

function App() {
  return (
    <div className="App">
      <Navbar section={sections}/>
    </div>
  );
}

export default App;
